// src/pages/LandingPage.js

import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const LandingPage = () => {
  const navigate = useNavigate();
  const [selectedRole, setSelectedRole] = useState('');

  // Handle role selection
  const handleRoleChange = (e) => {
    setSelectedRole(e.target.value);
  };

  // Handle form submission
  const handleSubmit = (e) => {
    e.preventDefault();

    // Redirect to the appropriate login route based on the selected role
    if (selectedRole === 'admin') {
      navigate('/login/admin');
    } else if (selectedRole === 'chimiste') {
      navigate('/login/chimiste');
    } else if (selectedRole === 'pharma') {
      navigate('/login/pharma');
    } else if (selectedRole === 'dev') {
      navigate('/login/dev');
    } else {
      alert('Veuillez sélectionner un rôle.');
    }
  };

  return (
    <div style={styles.container}>
      {/* Header Section */}
      <div style={styles.header}>
        <img src="/logo.png" alt="Logo" style={styles.logo} />
        <h1 style={styles.title}>Bienvenue sur Quantum Drug Design</h1>
        <p style={styles.subtitle}>
          Une plateforme dédiée à la gestion des molécules, l'analyse clinique et le développement scientifique.
        </p>

        {/* Role Selection Dropdown */}
        <form onSubmit={handleSubmit} style={styles.roleForm}>
          <label htmlFor="role" style={styles.label}>
            Sélectionnez votre rôle:
          </label>
          <select
            id="role"
            value={selectedRole}
            onChange={handleRoleChange} // Attach the handleRoleChange function
            style={styles.select}
            required
          >
            <option value="">--Choisir un rôle--</option>
            <option value="admin">Administrateur</option>
            <option value="chimiste">Chimiste</option>
            <option value="pharma">Pharmacien</option>
            <option value="dev">Développeur</option>
          </select>

          {/* Submit Button */}
          <button type="submit" style={styles.connectButton}>
            Se connecter
          </button>
        </form>
      </div>

      {/* Features Section */}
      <div style={styles.featuresContainer}>
        <h2 style={styles.featuresTitle}>Nos Fonctionnalités</h2>
        <div style={styles.featureCards}>
          <div style={styles.featureCard}>
            <h3 style={styles.featureHeader}>Authentication Multi-Rôle</h3>
            <p style={styles.featureDescription}>
              Accès sécurisé pour Admins, Chimistes, Pharmaciens et Développeurs.
            </p>
          </div>
          <div style={styles.featureCard}>
            <h3 style={styles.featureHeader}>Visualisation 3D</h3>
            <p style={styles.featureDescription}>
              Explorez les structures moléculaires en 3D avec précision.
            </p>
          </div>
          <div style={styles.featureCard}>
            <h3 style={styles.featureHeader}>Analyse Graphique</h3>
            <p style={styles.featureDescription}>
              Graphiques interactifs pour analyser les données scientifiques.
            </p>
          </div>
          <div style={styles.featureCard}>
            <h3 style={styles.featureHeader}>Monitoring des Modèles</h3>
            <p style={styles.featureDescription}>
              Suivez les performances des modèles IA/ML en temps réel.
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

// Styles
const styles = {
  container: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
    height: '100vh',
    backgroundColor: '#fff',
  },
  header: {
    backgroundColor: '#ff69b4', // Pink theme
    padding: '40px',
    borderRadius: '10px',
    boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
    marginBottom: '40px',
  },
  logo: {
    width: '50px',
    marginRight: '10px',
  },
  title: {
    fontSize: '2rem',
    fontWeight: 'bold',
    color: '#fff',
    textAlign: 'center',
  },
  subtitle: {
    fontSize: '1rem',
    color: '#fff',
    textAlign: 'center',
    marginTop: '10px',
  },
  roleForm: {
    display: 'flex',
    flexDirection: 'column',
    gap: '10px',
    alignItems: 'center',
    marginTop: '20px',
  },
  label: {
    fontSize: '1rem',
    fontWeight: 'bold',
    color: '#fff',
  },
  select: {
    padding: '8px',
    border: 'none',
    borderRadius: '5px',
    backgroundColor: '#fff',
    fontSize: '1rem',
    cursor: 'pointer',
  },
  connectButton: {
    padding: '12px 20px',
    backgroundColor: '#8a2be2', // Purple theme
    color: '#fff',
    border: 'none',
    borderRadius: '5px',
    fontSize: '1rem',
    cursor: 'pointer',
    transition: 'background-color 0.3s ease',
    marginTop: '20px',
  },
  featuresContainer: {
    maxWidth: '800px',
    margin: '0 auto',
  },
  featuresTitle: {
    fontSize: '1.5rem',
    fontWeight: 'bold',
    textAlign: 'center',
    marginBottom: '20px',
  },
  featureCards: {
    display: 'flex',
    justifyContent: 'space-between',
    flexWrap: 'wrap',
  },
  featureCard: {
    width: '23%',
    padding: '20px',
    backgroundColor: '#fff',
    borderRadius: '10px',
    boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
    marginBottom: '20px',
    textAlign: 'center',
  },
  featureHeader: {
    fontSize: '1.2rem',
    fontWeight: 'bold',
    marginBottom: '10px',
  },
  featureDescription: {
    fontSize: '0.9rem',
    color: '#333',
  },
};

export default LandingPage;
